import React, { Component } from 'react';
import './index.css';

class ShowList extends Component {
    render() {
        return <div className="list">
            <div className="task-list">
                <div className="left">
                    <input type="checkbox" />
                    <span>吃饭</span>
                </div>
                <div className="right">删除</div>
            </div>
        </div>
    }
}

export default ShowList;
